import React from "react";
import "./card_styles.css"
function Card_layout(recs) {
    
var recs = recs.recs;
console.log(recs.length);
var data = [];

for(var i in recs){
    console.log(recs[i]);
    data.push(recs[i]);
}


if(recs.length == 0) return <div class="table-wrapper"><p>No Recommendations</p></div>
  return(
   <music data={data}>  
   </music>
 
    
  )


}

function music(data){
    return (
        <div class="container">
        <div class="carousel">
        { 
                data.map((item, index) => (
                    
                        <input type="radio" name="slides" id={"slide-" + index}></input>                   
                )       
                )
            } 
            <ul class="carousel__slides">
            {                   
                data.map((item) => (
                
                <li class="carousel__slide">
                    <figure>
                        <div>
                            <img src={item.cover_url} alt=""></img>
                        </div>
                        <figcaption>
                            {item.name}
                            {item.artist}
                            {item.album}
                            
                        </figcaption>
                    </figure>
                </li>
                ))
            }
            </ul>
            <ul class="carousel__thumbnails">
            {
                    data.map((item, index) => (
                    <li>
                        <label for={"slide-" + index}><img src={item.cover_url} alt=""></img></label>
                    </li>
                    ))
                }
            </ul>
        </div>
    </div>
    )
  }

export default Card_layout;
